import React from "react";
import "../App.css";
import Banner from "../components/Banner";
import NewItems from "../components/NewItems";
import Footer from "../components/Footer";
import Testimonial from "../components/Testimonial";
import data from "../data.json";
import "./Home.css";

function Home() {
  return (
    <>
      <Banner />
      <div className="container">
        <div className="testimonial-container">
          <div className="sales-container">
            <p className="data">
              get answers to your burning questions from an experienced tarot
              reader
            </p>
            <ul className="data">
              <li>
                over
                <strong> 1,300</strong> readings given
              </li>
              <li className="data">4.9 stars average</li>
            <li className="data">300+ testimonials</li></ul>


          </div>
          <Testimonial testimonialData={data} />
        </div>
        <div className="thumbnail-container-container">
          <NewItems />
        </div>
      </div>
      <Footer />
    </>
  );
}

export default Home;
